-- This script builds a testing database by creating tables and inserting
-- the content to test against into them.
--
-- Before running this script you'll need to create your testing database
-- (CREATE DATABASE portal_testing; as a user with permissions to do so.)
-- and make sure it's a postgis database. (CREATE EXTENSION postgis; in
-- the newly created database.)
--
-- NOTE: This script does not create any of our changes in the database,
--       so you'll also need to make sure that migrations.sql is run, and
--       that it is run again if the migrations.sql file changes!
--
-- Run this script with something like:
-- psql portal_testing < testingdb.sql
-- psql portal_testing < migrations.sql
--
-- This script does *NOT* drop database or clear existing data, so the very
-- worst that could happen should you run it on the wrong database is inserting
-- junk data. This is very intentional. If you need to reset yoru testing
-- database completely use "DROP TABLE" commands manually.


--
-- Name: highways; Type: TABLE; Schema: portal; Tablespace:
--

CREATE EXTENSION postgis;

CREATE TABLE highways (
    highwayid smallint PRIMARY KEY,
    direction character(6) NOT NULL,
    highwaylength double precision,
    highwayname character(20),
    startmp real,
    endmp real,
    bound text
);

--
-- Data for Name: highways; Type: TABLE DATA; Schema: portal;
--



--
-- Name: stations; Type: TABLE; Schema: portal; Tablespace: 
--

CREATE TABLE stations (
    stationid smallint PRIMARY KEY,
    localjurisdiction smallint,
    controljurisdiction smallint,
    highwayid smallint,
    enabledflag smallint,
    milepost real,
    milelog real,
    milenumber real,
    locationtext text,
    length real,
    upstream smallint,
    downstream smallint,
    stationclass smallint,
    segment_odot smallint,
    numberlanes smallint,
    gisname text,
    smoothingconstant real,
    bridginglimit smallint,
    length_mid real,
    segment smallint,
    downstream_mile real,
    upstream_mile real,
    agencyid text,
    opposite_stationid smallint,
    segment_raw public.geometry,
    segment_50k public.geometry,
    segment_100k public.geometry,
    segment_250k public.geometry,
    segment_500k public.geometry,
    segment_1000k public.geometry,
    point public.geometry
);


--
-- Data for Name: stations; Type: TABLE DATA; Schema: portal;
--



--
-- Name: detectors; Type: TABLE; Schema: portal; Tablespace: 
--

CREATE TABLE detectors (
    detectorid integer PRIMARY KEY,
    highwayid smallint,
    enabledflag smallint,
    locationtext text,
    detectortype smallint,
    detectorclass smallint,
    detectortitle text,
    detectorstatus smallint,
    lanenumber smallint,
    stationid smallint,
    rampid smallint,
    controllerid smallint,
    end_date timestamp with time zone,
    start_date timestamp with time zone,
    milepost real
);


